import React, { Component } from 'react'
import { Row, Col, Modal, Input, Button, Select, message, Table } from 'antd';

const columns = [
    {
        title: 'Date',
        dataIndex: 'date',
    },
    {
        title: 'Debit / Credit',
        dataIndex: 'debcre',
    },
    {
        title: 'Description',
        dataIndex: 'description',
        sorter: (a, b) => a.age - b.age,
    },
    {
        title: 'Category',
        dataIndex: 'category',
    },
    {
        title: 'Account',
        dataIndex: 'account_type',
    },
    {
        title: 'Transcation Type',
        dataIndex: 'transcation_type',
    },
]

const data =[
    {
        date: 'Jan 20',
        debcre: 'DEBIT',
        description: 'Hello world',
        category: "FOOD",
        account_type: "cash_account",
        transcation_type: 'UPI Transfer'
    },
]

export class Transcation extends Component {
    render() {
        return (
          <div className="container-fluid">
            <Row>
                <Col span={12}>
                    {/* BreadCrumps */}
                    <div className="row">
                        <div className="col-lg-6">
                            <div className="page-title-box">
                                <div className="row">
                                    <div className="col">
                                        <h4 className="page-title">Transcations</h4>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </Col>
                <Col span={12}>
                    <Button type="primary" style={{ float: 'right', marginRight: '100px' }}>Add a Transcation</Button>
                </Col>
            </Row>
            <div>
                <Table style={{ marginTop: '70px' }} columns={columns} dataSource={data}/>
            </div>
          </div>
        )
    }

}

export default  Transcation;
